import React from 'react';

class MyStocks extends React.Component {
  render() {
    // console.log(this.props)
    const { stockBought } = this.props
    return(
      <div>
        <table>
          <tbody>
            <tr>
              <th>Ações</th>
              <th>Código</th>
              <th>Quant Carteira</th>
              <th>Comprado</th>
              <th>Venda</th>
              <th>Ganho</th>
            </tr>
          </tbody>
          <tbody>
            {stockBought.map((e) => 
              <tr>
                <td>{e.nome}</td>
                <td>{e.codigo}</td>
                <td>{e.quantidade}</td>
                <td>{e.precoCompra}</td>
                <td>12</td>
                <td>{e.precoCompra - 12}</td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    )
  }
}

export default MyStocks;
